This looks pretty good. Two questions/points.

- The code assumes the root object in each of the JSON inputs is a dictionary - can we add a check for this? 

- I find the merging logic a bit odd. Dictionaries are merged, lists are extended and everything else is replaced. Do we really want to extend lists? would a merge make more sense? i.e. treat it as a set to avoid duplicates.'}, {'account_id': 10992, 'date': '2014-05-14 19:50:37.000000000', 'content': 'Patch Set 2:

Hi Dougal,

This utility is written specifically to build up $OVERCLOUD_EXTRA_CONFIG variable used in passthrough feature from several sources. This explains odd logic in list processing:

  $ KEYSTONE_CONFIG_1=$(cat<<-EOF
  {
    "keystone": {
      "config": [
        {
          "section": "DEFAULT",
          "values": [
            {
              "option": "verbose",
              "value": "True"
            }
          ]
        }
      ]
    }
  }
  EOF
  )

  $ KEYSTONE_CONFIG_2=$(cat<<-EOF
  {
    "keystone": {
      "config": [
        {
          "section": "token",
          "values": [
            {
              "option": "provider",
              "value": "keystone.token.providers.uuid.Provider"
            }
          ]
        }
      ]
    }
  }
  EOF
  )

  $ json_merge.py -p "${KEYSTONE_CONFIG_1}" "${KEYSTONE_CONFIG_2}"

  {
    "keystone": {
      "config": [
        {
          "section": "DEFAULT", 
          "values": [
            {
              "option": "verbose", 
              "value": "True"
            }
          ]
        }, 
        {
          "section": "token", 
          "values": [
            {
              "option": "provider", 
              "value": "keystone.token.providers.uuid.Provider"
            }
          ]
        }
      ]
    }
  }'}, {'account_id': 8688, 'date': '2014-05-16 10:11:09.000000000', 'content': 'Patch Set 2:

(1 comment)

To avoid confusion over the merge strategy, maybe rename to EG "merge_extra_config.py"? Making the purpose explicit.'}, {'account_id': 6488, 'date': '2014-05-16 11:30:24.000000000', 'content': "Patch Set 2: Code-Review-1

This is strikingly similar to os-apply-config's deep merge code. I think we should put this into a library and consume it here and in os-apply-config if what os-apply-config already has is not sufficient.

Also extending lists is only right sometimes.. I think you might need a flag or rules on which keys are extended vs. replaced in that scenario."}, {'account_id': 10992, 'date': '2014-07-25 15:44:25.000000000', 'content': 'Abandoned'}]
